const originB64 = `data:image/jpeg;base64,`

const originB64Data = ``

func TestCheckMatchBase64Image(t *testing.T) {

	if !CheckMatchBase64Image(originB64) {
		t.Error("fail")
		return
	}

	t.Log("success")
}

func TestRegexSplitBase64String(t *testing.T) {
	b64File := ConvertBase64ToBase64File(originB64)

	if b64File.ContentType != "image/jpeg" && b64File.Encode != originB64Data {
		t.Error("fail")
		return
	}

	t.Log("success")
}

func TestBase64ConvertToFile(t *testing.T) {
	b64File := ConvertBase64ToBase64File(originB64)

	f := b64File.Base64FileConvertToFile("", "")
	defer os.Remove(f.Name())

	if _, err := os.Stat(f.Name()); err == nil {
		if err != nil {
			t.Errorf("file remove error:%v", err)
		}
		t.Log("success")
	} else if errors.Is(err, os.ErrNotExist) {
		t.Errorf("file not exist:%v", err)
	} else {
		t.Errorf("file not create success:%v", err)
	}

}

func TestAddFileByBase64(t *testing.T) {
	b64s := make([]string, 1)
	b64s[0] = originB64
	AddFileByBase64(b64s)
}
